page_script({init:function(){$(".tree .dropdown-toggle").click(function(){$($(this).parents("li")[0]).children("ul").toggleClass("collapsed")});$("#search_form").submit(function(a){a.preventDefault();app.ajaxify(location.origin+"/search?q="+$(this).find(".query").val())});$(".tree input[type=checkbox], .type input[type=checkbox]").change(function(b){if(b.originalEvent){$($(this).parents("li")[0]).children("ul").find("input[type=checkbox]").attr("checked",$(this).is(":checked"))}var c={ca:[],lo:[]};if(!$(".type .job").is(":checked")||!$(".type .shop").is(":checked")||!$(".type .company").is(":checked")){if($(".type .job").is(":checked")){c.jo=1}if($(".type .shop").is(":checked")){c.sh=1}if($(".type .company").is(":checked")){c.co=1}}$(".categories input[type=checkbox]").each(function(e,f){var g=$(this);var d=g.is(":checked");do{g=$($("input[type=checkbox]",$(g.parents("li")[1]))[0]);if(g.is(":checked")){d=false}}while(g.length&&d);if(d){c.ca.push($(this).attr("data-id"))}});$(".localities input[type=checkbox]").each(function(e,f){var g=$(this);var d=g.is(":checked");do{g=$($("input[type=checkbox]",$(g.parents("li")[1]))[0]);if(g.is(":checked")){d=false}}while(g.length&&d);if(d){c.lo.push($(this).attr("data-id"))}});$(".items_container").empty();var a=$.param(c);history.pushState({href:"/",method:"GET",params:a},document.title,"/"+(a?"?":"")+a);c.fetchdata=true;$.get("/",$.param(c),function(d){try{var g=JSON.parse(d);$(".filter-title").text(g.title);if(g.rslt.length){g.rslt.forEach(function(e){var h=$("#item_template").clone().removeAttr("id");h.find("[href]").attr("href",e.url);h.find("[data-href]").attr("data-href",e.url);h.find(".image").attr("style","background-image:url('"+e.image_url+"');");h.find(".title-text").text(e.title);h.find(".content-text").text(e.content);h.appendTo(".items_container").show()});window.fbAsyncInit();$(".home").hide()}else{$(".home").show()}}catch(f){console.log(d)}})})}});